const Item = ({item, item2}) => {
  return (
    <>
      <li style={{ color: "white", width: "400px", margin: "5px 0", fontSize: "24px"}}>{item}</li>
      <li style={{ color: "white", margin: "5px 0", fontSize: "24px" }}>{item2}</li>
    </>
  )
}

export default Item;
